def caculate_down_propotion(first_number,second_number):
    """
    计算时间顺序的下降比例
    :param first_number:  必须是列表参数的形式
    :param second_number: 必须是列表参数的形式
    :return:
    """
    # 衡量下降
    #最终储存的比例列表
    finall_propotion_list=[]


    num_old = 0
    for s in first_number:
        num_old = num_old + s
    print(num_old)

    num_new = 0
    for t in second_number:
        num_new = num_new + t
    print(num_new)

    finall_propotion_list.append((num_old - num_new) / num_old)
    return finall_propotion_list








